import React from 'react'
import Picker from 'react-scrollable-picker'
import { useState } from 'react/cjs/react.development'

/**
* @author
* @function LongTimeSelection
**/

const LongTimeSelection = (props) => {
    const [groups, setGroups] = useState({
        valueGroups: {
            title: 'Mr.',
            firstName: 'Micheal',
            secondName: 'Jordan'
          }, 
          optionGroups: {
            title: [
              { value: 'mr', label: 'Mr.' },
              { value: 'ms', label: 'Ms.' },
              { value: 'dr', label: 'Dr.' },
            ],
            firstName: [
              { value: 'John', label: 'John' },
              { value: 'Micheal', label: 'Micheal' },
              { value: 'Elizabeth', label: 'Elizabeth' },
            ],
            secondName: [
              { value: 'Lennon', label: 'Lennon' },
              { value: 'Jackson', label: 'Jackson' },
              { value: 'Jordan', label: 'Jordan' },
              { value: 'Legend', label: 'Legend' },
              { value: 'Taylor', label: 'Taylor' }
            ],
          },
    })

const handleChange = (name, value) =>{
    setGroups({
        valueGroups:{...groups.propsvalueGroups, [name]: value},
    })

}


  return(

        <Picker 
        optionGroups={groups.optionGroups} 
        valueGroups={groups.valueGroups}
        onChange={handleChange}
        />

   )

 }

 export default LongTimeSelection;
